Toni kept talking about Veronyca every chance she got. Every Wednesday she kept rushing off to softball practice for her kid instead of hanging out with us for the evening. She told me how gorgeous Vero was and how she just wanted to put in the face time and get her to hang out with us for a little while. The only time she had was right before she picked up her own son from school and took him to softball practice. Toni told her to come sunbathe with her for a little while before school was out and she thought it was a great idea to steal away some time for herself. Toni called her pal Levi over to help them oil up and also to keep them company. She really let her inhibitions go and went for the gusto with just a little helping hand from Toni and Levi. This tall and skinny MILF will make you totally question whether she has even ever had a kid at all. A pitch perfect MILF.
